        <div class="col-sm-3">
    <div class="card">
        <img src ={image} alt='' className="card-top-img" />
      <div class="card-body">
        <h5 class="card-title">{name}</h5>
        
        <a href="#" class="btn btn-primary btn-block">Select</a>
      </div>
    </div>
  </div>
    )
}
